import * as type from "../Action/type";
let initialState={
    credentials:[],
}
const UserReducer=(state=initialState,action)=>{
    switch(action.type){
        case type.FETCH_CREDENTIALS:{
            state.credentials=action.payload
        }
        default: return state;
    }
}
export default UserReducer
